<svg viewbox="0 0 942.93903 871.48495"
    xmlns="http://www.w3.org/2000/svg" onload="init(evt,1)">
  
    <script type="text/javascript">
     <![CDATA[



function init(evt, command) {
        if ( window.svgDocument == null ) {
          svgDocument = evt.target.ownerDocument;
        }
        if (command == 1) {
            $('.mapview').html("Median room price by post district");
            price();
        } else if (command == 2) {
                $('.mapview').html("Available rooms by post district");
                rooms();
        } else if (command == 3) {
            $('.mapview').html("Most wanted areas by post district");
                flatmates();
        } else if (command == 4) {
            $('.mapview').html("Difference between median flatseeker budget and median room price");
            difference();
        }

        };
    

function price() {
        for (var i = 0; i < json.length; i++) {
            var obj = json[i];
            var country = svgDocument.getElementById(obj.AREACODE);
            var median_price = parseInt(obj.MEDIAN_PRICE)
            if (median_price <= 650) {
                var newClass = ' colour' + 0;
                } else if (median_price <= 800  && median_price > 650){
                    var newClass = ' colour' + 1;
                } else if (median_price <= 950 && median_price >= 800) {
                    var newClass = ' colour' + 2;
                } else if (median_price > 950) {
                    var newClass = ' colour' + 3;
                }
        country.setAttributeNS(null, 'class', newClass);
        };
  };      
        
function difference() {
        for (var i = 0; i < json.length; i++) {
        var obj = json[i];
        var country = svgDocument.getElementById(obj.AREACODE);
        var difference = parseInt(obj.FLATMATE_MEDIAN_BUDGET) -  parseInt(obj.MEDIAN_PRICE)  
        if (difference >= 0) {
            var newClass = ' colour' + 0;
        } else if (difference < 0  && difference >= -90) {
            var newClass = ' colour' + 1;
        } else if (difference < -90 && difference >= -231) {
            var newClass = ' colour' + 2;
        } else if (difference < -231) {
            var newClass = ' colour' + 3;
        }
        country.setAttributeNS(null, 'class', newClass);
        };
  }; 

function rooms() {
        for (var i = 0; i < json.length; i++) {
        var obj = json[i];
        var country = svgDocument.getElementById(obj.AREACODE);
        var rooms = parseInt(obj.ROOMS)  
        if (rooms <= 50) {
            var newClass = ' colour' + 0;
        } else if (rooms <= 97  && rooms > 50) {
            var newClass = ' colour' + 1;
        } else if (rooms <= 157 && rooms > 97) {
            var newClass = ' colour' + 2;
        } else if (rooms > 275) {
            var newClass = ' colour' + 3;
        }
        country.setAttributeNS(null, 'class', newClass);
        };
  };         
        
function flatmates() {
          for (var i = 0; i < json.length; i++) {
        var obj = json[i];
        var country = svgDocument.getElementById(obj.AREACODE);
        var flatmates = parseInt(obj.FLATMATE_ADS)
        if (flatmates <= 1500) {
            var newClass = ' colour' + 0;
        } else if (flatmates <= 5375.5  && flatmates > 1500){
            var newClass = ' colour' + 1;
        } else if (flatmates <= 6260.5 && flatmates >= 5375.5) {
            var newClass = ' colour' + 2;
        } else if (flatmates > 6260.5) {
            var newClass = ' colour' + 3;
        }
        country.setAttributeNS(null, 'class', newClass);
          };
  };      

    ]]>
i = 1
var main = function() {

    $('#button').click(function() {
    if (i == 4) {
        i = 0
    }
    i = i +1
    init(null, i) 
    });
};
    
$(document).ready(main);
$(document).ready(function() {
    $('#button').click();
});

       </script>
